import useFetchData from '../hooks/fetchData';


const ProductPage = () => {

    const { data, error, loading } = useFetchData('products');


    if(error){
        return(
            <div>
                there was an error
            </div>
        );
    }

    if(loading){
        return(
            <div>
                THE PAGE IS LOADING
            </div>
        )
    }

    // this is the display for the items, its the list
    return (
        <>
            {data?.map((product) => {
                return (
                    <>
                    <button key={product.id}>
                        <p>{product.title}</p>

                    </button>
                    
                    </>
                );
            })}
        </>
    );
}


export default ProductPage;
